$(function(){
  if($(".main").height()< $(window).height()){
    $(".main").css('min-height',$(window).height() - 50 +'px');
  }
})


function fnTextVerify(oInput,span,count)
{
    var curLength;

    curLength = oInput.val()? oInput.val().length : 0;
    span.text('还能输入' + (count - curLength) + '字');
    oInput.on('input propertychange', function () {
        if($.syncProcessSign) 
            return ;  
        $.syncProcessSign = true; 
        if(count - $(this).val().length>=0)
        {
            span.text('还能输入' + (count - $(this).val().length)  + '字');
            span.removeClass('warningNum');
            oInput.removeClass('warningInput');
            $.syncProcessSign = false;  
        }
        else{
            span.text('超出' + ($(this).val().length - count)  + '字').addClass('warningNum');
            oInput.addClass('warningInput');
            $.syncProcessSign = false;  
        }
    });
}

function fnCreateRadiobox(radioBox){
    radioBox.ul = radioBox.ul || $("ul.radioBox");
    if(radioBox.haveOtherOption){
        radioBox.input = radioBox.input || radioBox.ul.next('input');
        if(radioBox.input.length == 0) radioBox.ul.prev('input');
    }else{
        radioBox.input = radioBox.input || radioBox.ul.prev('input');
    }
    radioBox.onClass = radioBox.onClass || 'on';
    $(radioBox.ul).children().last().css('margin-right','0');
    $(radioBox.ul).children().click(function(){
        $(this).addClass(radioBox.onClass).siblings().removeClass(radioBox.onClass);
        if(radioBox.input===false){
            return;
        }
        var $this = $(this);
        if(radioBox.boxUseType) {
            var radioAttr = radioBox.valBox?$this.find(radioBox.valBox).attr("useType"):$this.attr("useType");
        }
        else{
            if(radioBox.boxUseType != undefined) {
                var val = $this.attr("useType");
                $(radioBox.input).val($this.attr("useType"));
            } else {
                var radioText = radioBox.valBox?$this.find(radioBox.valBox).text():$this.text();
            }
        }
        radioBox.input.val(radioAttr||radioText);
        if(radioBox.haveOtherOption && $(this).hasClass("optSec")) {
            radioBox.input.val("");
        }
       
    });
}

function fncreateCheckbox(checkbox){


    checkbox.ul = checkbox.ul || $("ul.checkbox");
    checkbox.input = checkbox.input || $("ul.checkbox").prev('input');
    checkbox.onClass = checkbox.onClass || 'on';

    $(checkbox.ul).children().click(function(){
        $(this).toggleClass(checkbox.onClass);
    });

}

function fnCreateActionSheet(actionSheet){
    // actionSheet.btn
    // actionSheet.actionSheetDiv
    // actionSheet.actionCancelBtn
    // actionSheet.mask
    $(actionSheet.btn).bind('click',function(){
        var weuiActionsheet = $(actionSheet.actionSheetDiv);
        weuiActionsheet.addClass('weui_actionsheet_toggle');
        var mask = $(actionSheet.mask)||$('#mask');
        actionSheet.mask.show().addClass('weui_fade_toggle').click(function () {
            hideActionSheet(weuiActionsheet, actionSheet.mask);
        });
        if(actionSheet.actionCancelBtn){
            $(actionSheet.actionCancelBtn).click(function () {
                hideActionSheet(weuiActionsheet, actionSheet.mask);
            });
        }
        //weuiActionsheet.unbind('transitionend').unbind('webkitTransitionEnd');
    })
    
}
function hideActionSheet(weuiActionsheet, mask) {
    weuiActionsheet.removeClass('weui_actionsheet_toggle');
    mask.removeClass('weui_fade_toggle').hide();
    // weuiActionsheet.on('transitionend', function () {
    //     mask.hide();
    // }).on('webkitTransitionEnd', function () {
    //     mask.hide();
    // })
}

var dialog = {
		type : "confirm",
		content : "确定全部项目都检查无误了吗？",
		cancelFn : function() {
			return false;
		}
	};

function fnCreateDialog(dialog){
  // dialog.trigger 事件触发btn
  // dialog.type : confirm/alert 默认alert
  // dialog.title 标题内容
  // dialog.content 结构内容
  // dialog.confirmBtn: 确定按钮
  // dialog.cancelBtn: 取消按钮
  // dialog.id 弹框ID
  // dialog.confirmFn 确定回调函数
  // dialog.cancelFn 取消回调函数

  dialog.type = dialog.type||'alert';
  dialog.title = dialog.title||'提示';
  dialog.content = dialog.content||"";
  dialog.confirmBtn = dialog.confirmBtn || '确定';
  dialog.cancelBtn = dialog.cancelBtn||'取消';
  dialog.id = dialog.id ||'';
  dialog.confirmFn = dialog.confirmFn||function(){};
  dialog.cancelFn = dialog.cancelFn||function(){};

  var dialogDiv = "<div class='weui_dialog weui_dialog_"+dialog.type+"' id="+dialog.id+"> <div class='weui_mask'></div> <div class='weui_dialog'> <div class='weui_dialog_hd'><strong class='weui_dialog_title'>"+dialog.title+"</strong></div> <div class='weui_dialog_bd'>"+dialog.content+"</div> <div class='weui_dialog_ft'>";
  if(dialog.type=='confirm'){
    dialogDiv += "<a href='###' class='weui_btn_dialog cancelBtn default'>"+dialog.cancelBtn+"</a>";
  }
  dialogDiv += "<a href='###' class='weui_btn_dialog confirmBtn primary'>"+dialog.confirmBtn+"</a></div></div></div>";
  $('.main').css({'overflow':'hidden','height':$(window).height()+'px'});
  $("<div class='weui_mask'></div>").appendTo('body');
  $(dialogDiv).appendTo('body')
    .find(".confirmBtn").bind('click',dialog.confirmFn)
    .bind('click',function(){
      $(this).parents(".weui_dialog").remove();
      $(".weui_mask").remove();
      $('.main').css({'overflow-y':'auto','height':'auto'});
    })
    .end()
    .find(".cancelBtn").bind('click',dialog.cancelFn)
    .bind('click',function(){
      $(this).parents(".weui_dialog").remove();
      $(".weui_mask").remove();
      $('.main').css({'overflow-y':'auto','height':'auto'});
    })

}

